import {
    StyleSheet,
    Text,
    View,
    TouchableOpacity,
    Image,
    TextInput,
    ScrollView,
    FlatList,
    Dimensions,
    ImageBackground,
    ActivityIndicator,
} from 'react-native';
function About({ navigation }) {
    return (
        <View style={styles.container}>
            <Text style={{ fontSize: 32 }}>This is About page</Text>
            <TouchableOpacity
                style={{ backgroundColor: 'red', padding: 10, colour: 'white' }}
                onPress={() => navigation.navigate('Contect')}
            >
                <Text style={{ color: 'white' }}> Go to Content</Text>
            </TouchableOpacity>
        </View>
    );
}
const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
    },
});

export { About };
